車内からも車外からも全く透けない真っ黒な新しいフィルムです！<br>もちろん紫外線100%カット！<br><br>ドレスアップはもちろん、車上荒らしの防止やプライバシーの保護、冷暖房の効率アップなどなどいい事づくめです。<br>ガラス飛散防止にも役立ちます。<br><br>全ての車種のリアガラスに最適な「幅20cm x 5m巻」です。<br>リヤガラスなどの曲面ガラスに分割貼りするのに適したサイズです。<br><br>安心なジャパンクオリティー！日本製です。<br><br>◇仕様<br>可視光線透過率：0.004%<br>サイズ：20cm x 500cm<br>※全く透けないフィルムなので、安全運転の障害になるような場所には絶対に貼り付けないでください。<style type="text/css">
